import React from "react";
import classes from './styles.module.css';

const Yellow = () => {
	return (
		<>
			<div className={classes.lighter.red}></div>
			<div className={classes.lighter.yellow}></div>
			<div className={classes.lighter.green}></div>
		</>
	)
}

export default Yellow
